R["oh__@raia1"]="{['Key']='oh__@raia1',['TS']=1728781695,['Version']=1773,['eu']={[1]={['O']=19377,['N']='Gasthaus von Vulkhelwacht',['D']='Fezez in love',['C']=1.051000,},[2]={['O']=18973,['N']='Bündnis-Gasthaus',['D']='Housing does not have to be expensive. Small low budget home, limit for furniture was 5800 gold.',['C']=1.051000,},[4]={['O']=19072,['N']='Apartment in Himmelswacht',['D']='Student apartment in Skywatch',['C']=1.500000,},[5]={['O']=19084,['N']='Apartment in Schildwacht',['D']='Hallix - Luxury handmade jewellery from Sentinel',['C']=1.051000,},[6]={['O']=19834,['N']='Midnight Crisis',['D']='Mirri - There are moments in life when you simply need sweets.',['C']=1.050000,},[7]={['O']=19002,['N']='Schwarzreben-Haus',['D']='',['C']=1.020000,},[8]={['O']=19958,['N']='OId lady\\'s secret',['D']='A nice lady lives with her two cats in a cosy little cottage near Marbruk. Long walks through the idyllic countryside, coffee chats with the neighbours, a tranquil life. \\r\\nWell, sometimes appearances are deceptive.\\r',['C']=1.051000,},[11]={['O']=19122,['N']='Mobile Home',['D']='Mobile Home & Portal Hub\\r\\nWelcome to the mobile home of Mirri and Makes-Many-Soups !\\r\\nJoin us on our journey and discover cosy homes, magical places and sinister machinations.  \\r',['C']=1.006000,},[14]={['O']=19958,['N']='Magic Strike Force',['D']='Tamriel\\'s Special Forces\\r\\nWe protect the citizens of Tamriel no matter where in Aurbis they are. \\rWe that means: Our glorious commander captain Kaleen, Mio our little wizard, the assassin Pirharri, the crazy arcanist Azandar and last but not least me – Up here in the glass capsule (*wave*) I am One-eyed Joe the best navigator of all realms!\\r\\nYou are a prisoner of Molag Bal, Hircine hunts you down or a dragon burns down your house? \\rDon\\'t worry, we are on our way!\\r',['C']=1.020000,},[15]={['O']=19958,['N']='Small town',['D']='A small town where adventurers can buy rare books, magical weapons and other useful things. Have a look around and enjoy a piece of cake on the terrace. If you want to stay overnight, you can book a room in the local hotel.',['C']=1.041000,},[16]={['O']=19958,['N']='Victorious mice',['D']='Thank God, we found food! But this place is dangerous, it is the home of a giant and the delicious treasures are guarded by a monster. Its sharp fangs and deadly claws kill anyone who gets too close.\\r Some have already lost their lives, but we have no choice, the families are starving. Now, finally, we have outwitted the beast and locked it up. Commander Whitebeard and I will bring as much into the burrow as we can. But we must hurry, the giant will be back soon.\\r\\nAshley\\r',['C']=1.051000,},[18]={['O']=19959,['N']='Isobel\\'s Bakery',['D']='Isobel´s Bakery in Wayrest – Relax in a cosy environment and enjoy a cup of freshly brewed coffee and delicious pastries.',['C']=1.051000,},[19]={['O']=19329,['N']='Haus in Kragenmoor',['D']='Ärger in der Hexenküche',['C']=1.020000,},[22]={['O']=19957,['N']='Haus der Lachenden Monde',['D']='Mio Alvas is a gifted and somewhat weird mage, who is interested in rare forms of magic and, more recently, in shapeshifting. During his studies he discovered that life as a cat has its advantages. As a cat he felt brave and free and best of all, he could still cast magic. After a while he decided to give up his old life and roam the world as cat. He began the transformation one last time. Hours later, a black cat jumped onto the windowsill and disappeared into the night without looking back.',['C']=1.020000,},[23]={['O']=19981,['N']='Fezez magic carpets ',['D']='Fezezs transport company - Controlled by experienced pilots, our carpets will take you and your goods to any desired destination. Our patented Djinn technology ensures weather protection and a smooth flight. Please also note our “Bed and Breakfast��� offer: Sleep in our cozy “Featherbed” while our pilot Luna flies you safely through the night and enjoy a delicious breakfast from the picnic basket in the morning. For customers who want to fly themselves, we recommend our smaller rental carpets. ',['C']=1.020000,},[25]={['O']=19744,['N']='Baandari-Haus',['D']='Just a cosy little cottage',['C']=1.051000,},[26]={['O']=19170,['N']='Cyrodiil-Grenzhaus',['D']='The taste of blood\\r\\nVisit our shop near Elinhir in Craglorn and discover our exquisite selection of blood. Also don\\'t miss the next tasting event.\\r',['C']=1.051000,},[27]={['O']=19439,['N']='Haus in Arenthia',['D']='Welcome traveller, to the enchanted forest of the Strident Springs Demesne.\\r\\nDiscover mystical creatures, visit the Tower of the astronomer and the Hall of Eternal Fire. Assist Pirharri in her attempt to capture a part of the treasure and watch the dance of the dead for Mephala.\\r',['C']=1.021000,},[28]={['O']=19558,['N']='Haus in Nimalten',['D']='One of those days',['C']=1.051000,},[29]={['O']=19902,['N']='City Apartment',['D']='Centrally located in Windhelm, this cosy apartment with a modern touch is the perfect retreat.\\r\\nStep inside, close the door and leave the stress of the day behind you. Take a bath and make yourself comfortable on the sofa or enjoy a cup of freshly brewed coffee on the terrace. \\r\\nJust relax and be yourself \\r:-)\\n',['C']=1.050000,},[30]={['O']=19873,['N']='Haus in Riften',['D']='A cosy hotel in the countryside, a terrible crime and plenty of suspects. \\r\\nWho stabbed the famous Tales of Tribute player in her hotel room and where is the murder weapon? Can you help agent Mizzik Thunderboots to solve the case?\\r\\n',['C']=1.051000,},[31]={['O']=19958,['N']='Midnight rendezvous ',['D']='Vampires - Rendezvous at Midnight',['C']=1.050000,},[32]={['O']=19832,['N']='Liest-Haus',['D']='Cemetery at night \\r\\nCute ghosts, necromancy, eternal love, a creature of the night in an old grave and a lone visitor saying goodbye to a fallen hero. There\\'s a lot going on here late at night.\\n',['C']=1.038000,},[65]={['O']=20007,['N']='Mountain town',['D']=' The city under the mountain',['C']=1.041000,},[34]={['O']=18966,['N']='Haus in Hallins Wehr',['D']='',['C']=1.051000,},[35]={['O']=19959,['N']='Vampire Club',['D']='Welcome to the Hunters Club! On the upper floor you will find the exclusive members\\' area.\\r\\nEnjoy a glass of freshly tapped blood, selected individuals are available for consumption. After consultation with the reception, it is also permitted to bring your own prey. Please ensure that other members are not disturbed, hunters are liable for their prey.\\r',['C']=1.023000,},[101]={['O']=19954,['N']='Fashion',['D']='Explore the exclusive collection of luxury evening dresses and designer gowns and find the perfect dress for your special occasion. Also visit our terrace and discover the new collection designed by Mirri Elendis.',['C']=1.050000,},[70]={['O']=19987,['N']='Krempen-Tempel',['D']='Left: A cozy home in the countryside for Ember.\\r\\nRight: In a hidden valley on the shore of a lake you will find the tavern of Makes-Many-Soups. Get a bowl of soup, enjoy the wonderful scenery and relax.\\r',['C']=1.051000,},[39]={['O']=19045,['N']='Pakt-Herrenhaus',['D']='Bastian - Dark Magic',['C']=1.020000,},[104]={['O']=19959,['N']='Mirri\\'s residence',['D']='During her adventures, Mirri has earned enough gold to buy a beautiful estate on the coast of the Telvanni Peninsula. Safely hidden in the rocky coastal shore, surrounded by nature and with enough space for all her books. Butler Stibbons has moved into a chamber in the indoor garden and enjoys this peaceful place after a long day at work.',['C']=1.021000,},[73]={['O']=19346,['N']='Haus in Senchal',['D']='Cross the moonlight bridge and visit Biro-dar in his flying temple.',['C']=1.037000,},[43]={['O']=19965,['N']='AmayaLake Librarians',['D']='A group of mages roamed the world searching for new books and unknown manuscripts. Their insatiable thirst for knowledge impressed Hermaeus Mora and so he allowed them access to his endless library. In return, the mages repair damaged books and help in the search for lost manuscripts. The library is open to all visitors. However, particularly dangerous books are stored in a separate and protected building and the guardian Sharp-As-Night will do everything necessary to protect the books.',['C']=1.025000,},[44]={['O']=19965,['N']='Librarian Outpost',['D']='This enchanted castle is an outpost of the librarians and mages from the Amaya Lake Lodge. \\r\\nToday some special guests are here. Captain Kaleen and Mio from Tamriel\\'s special forces discuss with librarian Ember about a critical mission and also Agent Mizzik Thunderboots from the Ministry of Defence has just arrived.\\r\\nTogether they have to find a dangerous manuscript “Sweetroll ��� a deadly temptation” written by a mad baker hundreds of years ago, that was stolen from Hermaeus Moras realm.\\r',['C']=1.020000,},[78]={['O']=18778,['N']='Stadthaus in Einsamkeit',},[47]={['O']=19713,['N']='Ministry of Defence ',['D']='Ministry of Defence ������ The Reporting Office has its tentacles full dealing with the incoming messages, the communications department is pretty spooky and it takes ages to get an appointment at the Office for Hopeless Cases. But at least the canteen is open 24 hours a day and the postal service only cost a few grains. To keep everything under control, the management relies on brainstorming supported by Stibbons who now works as assistant to the mastermind and director.',['C']=1.020000,},[49]={['O']=18867,['N']='Hexenh�������uschen',['C']=1.020000,},[87]={['O']=19454,['N']='Zimmer im Gasthaus von Leyawiin',['D']='The sound of giant claws scraping on floorboards and the feeling of something creeping out of the darkness beneath the bed.\\r\\nSTOP, there is no monster under the bed, these are just stories to scare children.  \\r\\nWasn\\'t there a movement? \\r\\nI have to calm down, this is not real���\\r\\nScreeeeeck\\r\\nBut what… what if….\\r',['C']=1.038000,},[88]={['O']=19958,['N']='WG in Leyawiin',['D']='Shared House\\r\\nBastian and his housemates live in this nice house in Leyawiin. Each of them has their own personality, and the rooms are designed accordingly. If you can see FX, you\\'ll find also a book in the kitchen in which Bastian gives you some information about his housemates.\\r',['C']=1.051000,},[58]={['O']=19461,['N']='Alinor-Gasthaus',['D']='Elendis real estate agency – the number one in Tamriel\\r\\nAre you looking for a new home? \\r\\nWhether you are searching for a cosy cottage, a luxury property, a castle or a unique private temple, we fulfil every wish. \\r\\nVisit our office in Alinor and have a look at our exclusive range of properties.\\r',['C']=1.051000,},[59]={['O']=19958,['N']='Superhero base',['D']='Have you ever had the chance to see the headquarters of a superhero? If not, here\\'s your chance. She is not at home and her butler Bastian is preparing the meal in the kitchen. So go on, sneak into the house and find the secret entrance. A little tip, you have to go through fire.',['C']=1.051000,},[81]={['O']=19475,['N']='Hjaalmarsch-Galerie',['D']='This is the residence of L. Salingor, globetrotter and member of the Royal Archaeological Association of Alinor. I am not at home, but you are welcome to take a look around and rest from the long journey in the guesthouse by the lake. Our mutual friend Bastian told me you were recently on High Isle? If you would like to join me later for dinner, I would be excited to hear more about your adventures.\\r\\nSincerely yours, L. Salingor\\r',['C']=1.047000,},[71]={['O']=19645,['N']='Tree House',['D']='Cosy tree house in a hidden valley in Elsweyr.',['C']=1.020000,},[62]={['O']=19958,['N']='Fight for a book',['D']='Led by the renegade Necrom Guard Miraso, monsters and undead creatures have gained access to the castle at the end of time to steal a magical book. The librarians from the Amaya Lake and their friends fight side by side with powerful bookworms to protect the book. But when an angry giant from another dimension enters the battlefield, Sharp-as-Night sees only one chance. He breaks the sacred hourglass and time stands still. Frozen in time, the companions hope for Biro-dars help. ',['C']=1.020000,},[95]={['O']=20008,['N']='Alchemy',['D']='\\rFrom the moment Alchemy stepped on stage, her presence commanded attention. Her performance was both nuanced and powerful, providing the audience with a deeply emotional experience. Her talent, dedication and ability to connect with the audience make her an outstanding actress, worthy of both applause and admiration. (It is strongly recommended that you do not leave the room without applauding and paying homage to the performer).\\r\\n',['C']=1.023000,},},}"
