R["oh__@madroguemage"]="{['Key']='oh__@madroguemage',['na']={[16]={['D']='Blackfeather Bakery is open to all paying customers, winged or otherwise. ',['C']=1.024000,['O']=19541,['N']='Blackfeather Bakery',},[49]={['D']='The witch may not be home, but you should still watch out for mischevious familiars! (Linus the Netch is chill though, he\\'s just waiting for the Great Pumpkin.)',['C']=1.023000,['O']=19642,['N']='Home, Haunted Home',},[18]={['D']='A Mage Guild library: Amenities include a Study Lounge and Lecture Hall, currently in use for a dissertation on Sharks of Tamriel.\\n\\nThe upper floor has been sectioned into Religion, Lore by Region, Fiction, and Non-Fiction. The lowest floor houses our restricted section, please obtain permission before use. ',['C']=1.025000,['O']=19677,['N']='Mage Guild Library',},[99]={['D']='Come, ye faithful of Peryite! Come and spread his blessings across the seas. The Knathen Flu is a dreaded memory for most, but sweet inspiration for our holy ship! Come and prepare plagues of the Soul, diseases of the Blood, corruption of the Lands, and the entrapping rot of Temptation. Share Peryite’s love with all of Tamriel!',['C']=1.037000,['O']=19647,['N']='The Foul Winds',},[101]={['D']='LIVE IN CONCERT\\n\\nLYRANTH\\n\\nLIMITED EDITION VINYL / AUTOGRAPHS\\n(Tickets: 2 souls)',['C']=1.050000,['O']=19785,['N']='TONIGHT ONLY Bar',},[27]={['D']='Stole an ide- I mean, I was inspired by @shutterbug1023 Little People Village to make my own nixad village. ',['C']=1.020000,['O']=19563,['N']='Hidden Nixad Village',},[59]={['D']='The Gryphon Garrison, a house where four dutiful soldiers care for a flock of young gryphons. ',['C']=1.007000,['O']=19541,['N']='Gryphon Garrison',},[28]={['D']='Take a journey through the Enchanted Easel to see the world\\'s most famous painting!\\n',['C']=1.044000,['O']=20008,['N']='Into The Art',},[45]={['D']='Consider yourself fortunate, graduate of Shad Astula. You have been granted apprenticeship within the great House Telvanni. Here in Tel Galen, you will achieve mastery of Alchemy and Conjuration, with focused studies on rare mushroom cultivation. (Note that all proceeds from sales of potions and reagents will be applied toward your apprenticeship fees.)',['C']=1.020000,['O']=19603,['N']='Telvanni Tower',},[30]={['D']='Mammoth Head Meadery invites you to sample their fine selections! ',['C']=1.021000,['O']=19543,['N']='Mammoth Head Meadery',},[78]={['D']='Hawkmere Menagerie has remodeled some of our exhibits!\\n\\nCome visit our FOURTEEN creatures (Fifteen if you count the Butterfly Room!) Don\\'t forget to visit the patio Food Court for refreshments as well!',['C']=1.019000,['O']=19817,['N']='Hawkmere Menagerie',},},['Version']=1773,['TS']=1728708993,}"
