R["oh__@anjasa"]="{['TS']=1727617693,['Key']='oh__@anjasa',['na']={[56]={['O']=19987,['N']='The Dwemer Promenade',['C']=1.041000,['D']='The Tel Dwemolihn Promenade allows Telvanni students to rest and relax in an expansive Dwemer ruin. Featuring a staffed kitchen, reading room, and several areas for experimentation and magic. Enjoy the striking vistas, an unearthed Mephala shrine, and a lovely hotspring, all beneath an unnatural sun.\\n\\n(Telvanni style meets Dwemer construction in this fully custom underground build.)',},[81]={['O']=19987,['N']='The Dwemer Gardens',['C']=1.041000,['D']='The Tel Dwemolihn gardens contain a partial dwemer ruin with a small cave system, dwemer buildings connecting it to the rest of the Telvanni estate. The gardens provide much of the reagants for the alchemical needs of the Tel, and provides working space for experiments and harvesting.\\r\\n\\r\\n(Custom dwemer build, complete original design.)',},[45]={['O']=19995,['N']='Fantastical Campus',['C']=1.020000,['D']='Located on the Tel Dwemolihn estate in Northern Vvardenfell, off the Sea of Ghosts.\\r\\n\\r\\nCome tour the campus dormatories, where dedicated Telvanni students are offered a private room. From striking vistas, to a magical common area, the dorms have been carefully cultivated to provide a relaxing and attractive home-away-from-home.\\r\\n\\r\\n(No external FX required, finished Telvanni tower. Features custom entrance, baths, beds, vanities.)',},[43]={['O']=19917,['N']='Hla Dra Spa',['D']='Come relax and enjoy the Hla Dra Spa, an exclusive pleasure resort in Vvardenfell. Amenities include a sauna with a full bath and shower, an outdoor hot tub, a tea room, a massage parlour, and a private dance lounge.\\r\\n\\r\\n(No FX, completed house. Features original fish tank, hookah den, swimming pool, and lush gardens.)',['C']=1.028000,},},['Version']=1773,}"
