R["oh__@melaniemaren"]="{['Version']=1773,['TS']=1727019075,['eu']={[33]={['N']='Briarheart Hollow',['D']='Briarheart Hollow is every Necromancer\\'s dream of a cozy nature retreat. Be sure to not jump down into the Hollow before having a look inside the skull. There is no way back up. ',['C']=1.023000,['O']=19970,},[58]={['N']='Under the Sea',['D']='a small corner of the ocean',['C']=1.012000,['O']=19736,},[71]={['N']='3 Banners Playground',['D']='This ancient forest is where veterens of the Three Banners War fight under the gaze of Sithis while others attempt to reach treasure in a jumping puzzle that will drive people mad. ',['C']=1.005000,['O']=19755,},[28]={['N']='The Jarl\\'s Flagon',['D']='The Jarl\\'s Flagon welcomes all travelers to come in  after a long day of adventuring.',['C']=1.024000,['O']=19736,},[37]={['N']='Hollywell Cottage',['D']='Nestled deep in the remnants of Valenwood, Holywell Cottage enchants its visitors with its simple charm. Today everything is prepared for a birthday celebration with friends coming to enjoy a delightful afternoon. Come along to unwind by the creek and relish the whispy essence of flowers in the air. For as we know, magic is in the small wonders that surround us everyday. We only need to open our eyes to see them.',['C']=1.033000,['O']=19867,},[14]={['N']='Nirn Crux Mine',['D']='This mine has more to offer than just nirncrux. Watch your step!',['C']=1.026000,['O']=19736,},[103]={['N']='Moonlight Sanctuary',['D']='Take a stroll in the colorful gardens surrounding the pools and waterfalls of the Moonlight Sanctuary. Hope you enjoy wandering the many paths and exploring the sparkling surprises in this quiet retreat. ',['C']=1.037000,['O']=19988,},},['Key']='oh__@melaniemaren',}"
