R["oh__@ladyelysium"]="{['TS']=1725552590,['Key']='oh__@ladyelysium',['na']={[81]={['D']='Children of Lamae Bal are invited to join Ecclesia Sanguinum, a Vampiric place of worship tucked away in a small pocket of Coldharbor. Perfect for hosting ceremonies, the church features a sacrificial altar, contract assignment booth, stocked library, memorial room, area to meet with the heads of the church, ashes-of-the-fall tribute (with a magical triptych), and a candlelit contract \\'prayer\\' station. A basin of Loss and Soul-Sworn thrall are also available to all.',['O']=19473,['N']='Ecclesia Sanguinum',['C']=1.007000,},[70]={['D']='I created this outdoor wedding venue for my Khajiit J\\'Akeelah and her spouse, Jo\\'Nazhuud. This location is free for all RP use - please message me if you\\'re getting wed here & would like something added/removed temporarily.',['O']=19971,['N']='Khajiit Wedding',['C']=1.022000,},[7]={['D']='Take your dinner date to an abandoned home overrun by plant life!',['O']=19182,['N']='Grotto Getaway',['C']=1.021000,},[104]={['N']='Assassin\\'s Abode',['O']=19954,['D']='Hidden deep in a mushroom forest lies the abode of Walks-Beyond-Reason, a Dark Brotherhood Shadowscale who runs an illicit services and procurement business from the location. When they\\'re not butchering, skinning, and slaughtering illegal meat and fur for their customers, they are handling their assassin duties in style, worshipping Hha-Lugh-Zekh & Sithis, or collecting trophies from their kills. This house is used for RP with the character :)',['C']=1.023000,},[59]={['D']='This is an RP house Altmer Kari Thaorian. She recently had to return to Alinor after her parents passed to take over the family shipping business. The home is full of her family\\'s old furnishings and she has yet to redecorate to her taste. The house features an entryway waiting room, a business office, an entertaining room, a small kitchen, her sibling\\'s sleeping area, her own sleeping area (formerly her parents) & a gallery of treasures her parents collected.',['O']=19837,['N']='Thaorian Residence',['C']=1.007000,},[103]={['D']='Step into the dark allure of Fangs & Fortunes Bar \\'n Casino, where the night truly comes alive! Indulge in our fully stocked blood-bar, savoring the finest alcoholic concoctions while enjoying some live entertainment. Feeling lucky? Try your hand at our small yet thrilling casino floor. For those seeking utmost privacy, our VIP room awaits, available for exclusive \"meetings\". Non-mortals are welcome but must be accompanied by a vampire companion throughout their stay. (This place is open for RP)',['O']=19954,['N']='Fangs & Fortunes Bar',['C']=1.007000,},[17]={['D']='Welcome to the cozy abode of friends Al\\'zaviir and Androlynne, two masterful Artificers that have crafted the home perfect for their Clockwork \\'n Dwemer endeavors. This shared sanctuary features beds for restful nights, a well-equipped kitchen for culinary adventures, a small library for intellectual pursuits, and workstations tailored for tinkering and magical experiments!',['O']=19879,['N']='Artificer\\'s Abode',['C']=1.027000,},[62]={['D']='Take a wander around the lush environment of The Statue Garden of Artaeum and enjoy the beautiful stone workmanship from all over Tamriel. Little statues are hidden all over the place, maybe start with Stendarr? ',['O']=19560,['N']='The Statue Garden',['C']=1.021000,},[47]={['D']='Visit the location in Coldharbour where vampire Dalarya Serayne is currently beind held & tortured by High Priestess Morvani. The location includes Morvani\\'s office for plotting, the torture area, a throne area for Morvani to sit and throw knives at Dalarya when she\\'s not being tortured. (Dalarya is in her bird form here). Bonus room: Prisoner holding area... the hog is hungry.... **TRIGGER WARNING: Torture** This is used for RP purposes, you may use it also if you wish! ',['O']=19810,['N']='Morvani\\'s Lair',['C']=1.023000,},},['Version']=1773,}"
