R["oh__@jaywolfing"]="{['Version']=1773,['Key']='oh__@jaywolfing',['TS']=1724643523,['na']={[16]={['N']='Drop Shop',['O']=19275,},[3]={['D']='A simple Dunmer-themed inn room.',['N']='Ebonheart Inn',['C']=1.051000,['O']=19274,},[6]={['D']='A cave tucked away behind a waterfall.',['N']='Waterfall Cave',['C']=1.020000,['O']=19274,},[87]={['D']='For arranging business deals or playing board games with friends.',['N']='Office',['C']=1.007000,['O']=19274,},[57]={['D']='A prime location for parties and feasting, with an indoor hot spring and piles of pillows and thick rugs for a relaxing experience.',['N']='Golden Indulgence',['C']=1.013000,['O']=19274,},[10]={['D']='The energies of Nirn can be harvested just as that of a soul, and the magical potential of volcanic flows lend theselves well to the uses of the enchanter that has crafted this workshop for himself deep below the surface of High Isle.',['C']=1.020000,['N']='Enchanting Workshop',['O']=19961,},[91]={['D']='This wedding venue sports an array of flowering trees, a dance floor, and even pools for wading. Bring a few friends or many to witness your big day, and celebrate in style.\\n\\nCurrent theme: Serpents\\n\\nMail @Jaywolfing if you\\'d like to use this home for any events',['N']='Wedding Venue',['C']=1.007000,['O']=19800,},[13]={['D']='[Lie] I don\\'t even worship daedra.',['N']='Shrine to Namira',['C']=1.038000,['O']=19955,},[78]={['D']='\"In the gaze of Lady Dibella, come and share your beauty, be it of voice and music, of creative hands, or of the spirit of movement. In all you do, love and be joyous.\"\\n\\n[Location-agnostic] This temple is centered around the creative arts such as painting, pottery, and music. Sections for massages and wine-drinking  feature, however pleasure of the flesh is NOT a theme of this location. (Be polite, this both IC and OOC a public space)',['N']='Temple of Dibella',['C']=1.007000,['O']=19926,},[38]={['D']='Bard and Bloom Inn is a cozy space just north of Daggerfall\\'s walls overlooking the sea. It features stages for performers, a heated pool, along with all the usual comforts of an inn. There are some outdoor sleeping options for those who prefer a more natural experience, as well as a gaming area in the upper tower.',['N']='Bard and Bloom Inn',['C']=1.007000,['O']=19417,},},}"
