R["gb__na__@lillfox__15"]="Aaralyn Noel (@brittuhh),1718478722;Chrispi Critters (@zendyra),1716253107;Cirranwe (@Kitsunaria),1660829744;Nym Baenre (@Seminolegirl1992),1629370831;Elur Steggun (@K_Aux),1596852627;Winterröse (@Chryseia),1593980113;Helvthor Wulfharth (@CurigadorRogue2112),1593969758;Káthryn (@Shenzi70),1593958397;Hazel Heartwood (@Oakberry),1593955671;Lady Fuyu (@Lady_Pan),1593915182;All'that (@Toadsticker18),1593914909;Jennah Talonhawke (@Tulien),1593913768;danaluberry (@danielder6),1593907360;Leah Sophina (@MISTAERIE),1593907120;Damanor (@Feendish898),1593906558;Kallie Royale (@Marleibear),1593859239;Daro Gore-paw (@EchoTiger),1590793535;A'gronas (@eohippus),1586921675;Stabbitee (@StabbityDoom),1586793567;"
R["fx__eu__@raia1__88"]="{['Version']=1773,['Effects']={[1]={['Color']=74898,['SizeY']=40,['EffectType']=8503,['Yaw']=3.466224,['X']=53018.438455,['Roll']=0,['MetaData']={['message']='Hi, I am Bastian, sword master and blacksmith. A few years ago, my uncle left me this house. I\\'ve made myself comfortable in the cellar, where I can work on my armour and weapons. The house is too big for me alone and I decided to look for house mates. \\n\\nDeras was the first to move in. He seems a bit creepy, but when you get to know him, you realize that he\\'s a really nice guy. He just likes this \"dark side\" thing, a little necro. He has outstanding healing skills and is well-versed in herbalism. He saved my ass after a fight once and now we are best friends.\\n\\nEmber - A wonderful person, we all love her. She\\'s really into all this fairy, princess, prince charming stuff. But her last lover was such a snobbish, stupid idiot. Some days ago, he made her cry. Mirri and I could have killed him. Azandar just looked at her but said nothing. When the guy came by today, he offered him one of his \"special\" teas. Just say squeak - he will have a lot of fun with our cat.\\n\\nAzandar  - Well, this guy is totally crazy. Met him in the pub. Afterwards, he came round for a few beers and just stayed. He is an arcanist and regularly drives us crazy. Especially Mirri who has the room next door. But if you really need him, he\\'s there for you. Oh and he cooks incredibly well. His Riverhold Beef Pasty - unbelievable!\\n\\nMirri joint us a year ago. She seems quite arrogant and at the beginning I didn\\'t think she would fit in with us. But she settled in quickly. She is a member of the Mages Guild and studies old artefacts. A really smart and eloquent person. From time to time there are heated arguments between her and Azandar, thank God my room is in the other part of the building :-) \\n\\nLiving in a shared house is not always easy, but I wouldn\\'t want to miss a day with these crazy people.\\n',['title']='Housemates',},['Id']=1406,['SizeZ']=40,['Alpha']=1,['SizeX']=30.456456,['Z']=52558.588741,['Pitch']=4.712564,['Contrast']=2.400000,['Y']=20637,['Groups']=0,},[2]={['SizeY']=60,['Z']=52560.788286,['Yaw']=3.373721,['Pitch']=0,['Roll']=0,['Y']=20633,['Id']=1409,['EffectType']=72,['Alpha']=1,['SizeX']=56,['X']=53017.098893,['Color']=869988,['Contrast']=2.900000,['SizeZ']=60,['Groups']=0,},},['TS']=1718461430,}"
