R["oh__@kolapsworld"]="{['eu']={[14]={['D']='Ember loves enchanting and performing crazy magical experiments, that\\'s why she spent a lot of time traveling the Nirn to gather lots of resources for her new hideout. She harvested everything carefully, fought a lot of battles and picked more than a few pockets to earn what she has. But still Ember\\'s crazy and chaotic nature can create disasters even in her own place! Sometimes Ember is lazy and this doesen\\'t give her a chance to finish all of her eccentric experiments.',['N']='Ember\\'s Hideout',['O']=19715,['C']=1.002000,},[81]={['D']='My soul vibes of Shivering Isles.\\n\\nThis house was created with my wish one day to see the Shivering Isles in TESO. This house is like a realm for me that combines existing nature and some vibes of the Isles. Some strange power created this realm. \\n\\nWhen you enter the house you will see small pieces that will show you what can wait for you after entering the main portal. \\nAfter you in feel free to look everywhere.',['N']='Hjaalmarch Gallery',['O']=19864,['C']=1.026000,},[70]={['D']='My soul vibes of Shivering Isles.\\n\\nThis house was created with my wish one day to see the Shivering Isles in TESO. This house is like a realm for me that combines existing nature and some vibes of the Isles. Some strange power created this realm. \\n\\nWhen you enter the house you will see small pieces that will show you what can wait for you after entering the main portal. \\nAfter you in feel free to look everywhere. ',['N']='Rimmen Temple',['O']=19864,['C']=1.026000,},[10]={['D']='Halloween cave',['N']='Halloween cave',['O']=19691,['C']=1.022000,},},['Version']=1773,['TS']=1716331144,['Key']='oh__@kolapsworld',}"
