R["oh__@grumlen"]="{['Key']='oh__@grumlen',['TS']=1716088938,['na']={[98]={['D']='This ancient khajiit port fell to obscurity long ago, when a seismic event caused its surrounding cliffside to crumble into the bay and rendered it useless for commerce. In the many moons since, the structure found new purpose after the ruins encompassing it were rediscovered by various displaced travelers, eventually forming the small town of Strayhome. The neighborhood of Wharfside sits on its outskirts, occupied by a scattering of pirates looking to take advantage of this opportune isolation.',['N']='Wharfside Strip',['O']=19862,['C']=1.007000,},[89]={['D']='Long hidden deep within some forgotten Imperial sewers of the port town of Strayhome sits the Patchwork Menagerie. Built upon the bones of an old Khajiiti temple, this underground fighting arena is now home to a scattering of local thieves and undesirables looking to make their name brawling for the amusement of other destitute strangers.',['N']='Patchwork Menagerie',['O']=18998,['C']=1.007000,},},['Version']=1773,}"
