R["fx__eu__@raia1__43"]="{['TS']=1715987304,['Version']=1773,['Effects']={[1]={['EffectType']=8503,['SizeX']=26.456456,['Contrast']=4,['Roll']=0,['Yaw']=5.471607,['Z']=47281.706389,['Y']=4345,['MetaData']={['title']='Teil 1 - Der Wächter',['message']='Die Gesandte der Magiergilde trat ein und verbeugte sich. Gerissen-wie-die-Nacht bedeutete ihr sich zu setzen, ging zu dem in der Wand eingelassenen Tresor und entnahm das Buch. Er legte es vor ihr auf den Tisch und sie begann schweigend mit der Arbeit.\\n\\nEr musterte sie noch einen Moment, dann wandte er sich einem der Regale zu. Der Einband eines der Bücher war über Nacht sichtbar gealtert. Jedem Buch wohnte eine eigene Art von Magie inne und Veränderungen äusserten sich nicht selten in einer Anpassung ihres Erscheinungsbildes. Doch seine Studien mussten warten. Solange ein Gast in diesem Raum weilte, durfte er keine Ablenkung riskieren.\\n\\nEr drehte sich zu der Magierin um. Sie sass tief gebeugt über dem Buch, die Stirn konzentriert in Falten gelegt. Gerissen-wie-die-Nacht setze sich an einen Tisch. Während er wartete, liess er seine Aufmerksamkeit durch den Raum wandern. Das flackernde Licht der Kerzen, ab und an ein leises Knacken im Gebälk. Er nahm den leichten Geruch nach altem Pergament war, den Duft nach Weihrauch und... \\n\\nWeihrauch?\\n\\nEr sprang auf und sah angespannt in Richtung der Magierin. \\n\\nDie Luft um das Buch begann zu wabern. Blitzschnell sprang er vor und riss die Frau von ihrem Stuhl. Doch es war zu spät. Das Gesicht der Magierin hatte sich zu einer Fratze verzerrt und sie starrte ihn aus hasserfüllten Augen an. Das Buch in ihren Händen pulsierte, Magie zuckte um ihre Fingerspitzen. \\n\\nIm nächsten Moment traf ihn die Entladung und schleuderte ihn zurück. Der Schmerz war grausam und jeden anderen hätte der Angriff auf der Stelle getötet. Doch er war ein Kind der Mutter der Nacht und stand zudem als Wächter unter dem Schutz Hermaeus Moras. Er wich dem nächsten Angriff aus und stürzte sich mit gezücktem Dolch auf die Angreiferin. ',},['SizeY']=30,['Groups']=0,['Pitch']=4.712564,['X']=50465.106225,['Color']=153366,['Id']=1384,['Alpha']=1,['SizeZ']=30,},[2]={['EffectType']=8503,['SizeX']=26.456456,['Contrast']=1.660000,['Roll']=0,['Yaw']=0.591667,['Z']=47330.982466,['Y']=4345,['MetaData']={['title']='Teil 2 - Die Magierin',['message']='Nach langer Zeit hatte Balmea es endlich gefunden. Dieses Buch würde die Geheimnisse um die Macht der Ayleïden enthüllen und das Wissen darum würde ihr den Weg in die obersten Ränge der Magiergilde eröffnen. Doch zuerst kam die Arbeit.\\n\\nDie Warnungen Biro-dars hallten noch in ihren Ohren. Die Bücher in diesem Raum waren gefährlich und jede Unachtsamkeit konnte das Ende bedeuten. Sie musste vorsichtig sein. \\n\\nWährend ihre Finger über die Seiten wanderten, schien es ihr, als würde sie in die Geschichte eintauchen. Stück für Stück löste sich ihr Geist von der Wirklichkeit, verwob sich mit der Geschichte, wurde eins mit ihr. Nach all der Zeit lagen die Geheimnisse nun offen vor ihr. Die Macht der Ayleïden war noch immer da, sie warte nur auf jemanden der würdig war. Wartete... auf... SIE\\n\\nEin Kribbeln durchfuhr ihren Körper und ihre Hände schlossen sich fest um das Buch. \\n\\nDas Einzige, was sie tun musste, war weiterzulesen und der leisen Stimme zu folgen die sie immer tiefer in die Geschichte führte dorthin, wo auch das letzte Geheimnis gelüftet werden würde. \\n\\nUnd Balmea, dem Ziel ihrer Träume so nahe, vergass alle Vorsicht und folgte der Stimme. Tiefer, bis an den Grund ihres Bewusstseins, bis sie vergass, wer sie war und woher sie kam, bis sich ihr Geist auflöste und schliesslich erlosch.\\n\\nWährend sich ihre Magie mit der des Buches verband, erfüllte es ihre leere Hülle mit dem Willen seines Meisters. Es verwandelte sie in ein Werkzeug mächtig genug, um es aus seinem Gefängnis zu befreien und endlich seiner Bestimmung zuzuführen. Seinen Meister zu finden und in das Reich der Lebenden zurückzubringen.\\n\\nDoch der verdammte Wächter war aufmerksam geworden - Er musste fallen.',},['SizeY']=30,['Groups']=0,['Pitch']=4.712564,['X']=50589.647277,['Color']=183783,['Id']=1389,['Alpha']=1,['SizeZ']=30,},[3]={['EffectType']=8503,['SizeX']=26.456456,['Contrast']=1.250000,['Roll']=0,['Yaw']=4.769985,['Z']=47449.647149,['Y']=4253,['MetaData']={['title']='Teil 3 - Das Ende',['message']='Gerissen-wie-die-Nacht stürzte auf die Magierin zu, den Dolch in der Hand, der im Schein der heranrasenden magischen Entladungen aufleuchte. Es lagen nur wenige Schritte zwischen ihnen, doch er hatte das Gefühl eine Ewigkeit zu brauchen. Als er sie fast erreicht hatte, katapultierte er sich mit einem gewaltigen Satz auf sie zu und riss sie zu Boden. Die freigesetzte Magie zuckte um seinen Körper und verursachte schier unerträgliche Schmerzen. Doch Gerissen-wie-die-Nacht hob noch im Fallen den Dolch und stiess ihn mit tödlicher Präzision durch ihren Rücken direkt ins Herz. Ihr Körper erschlaffte und sie war tot noch ehe sie auf dem Boden aufschlug.\\n\\nSchwer atmend erhob er sich und sah auf die Frau hinab. Das Buch war ihr aus den Fingern geglitten, das Leuchten war erloschen. Reste von arkaner Energie umspielten die Tote, doch auch sie würden bald vergehen. Gerissen-wie-die-Nacht seufzte. Er hatte seine Aufgabe erfüllt, die Welt war sicher. Und doch, einmal mehr hatte eines der Bücher ein Opfer gefordert. Er musste die anderen informieren, gemeinsam würden sie überlegen was mit dem Buch zu tun sei. \\n\\n... Das Buch lag am Boden, nahe der Stelle an der die Magierin zu Boden gegangen war und für einen Moment schimmerten einige Spritzer ihres Blutes rot auf dem ledernden Einband. Dann sickerten sie in das rissige Leder, fast als würde das Buch sie aufsaugen. \\n\\nDer Versuch zu entkommen war gescheitert. Doch es würde warten, auf den Tag an dem der Wächter schwächer würde und ein anderer beeinflussbarer Geist es wagte seine Seiten zu berühren. Auf den Tag an dem sein Meister zurückkehren und die Welt für immer verändern würde.\\n\\nDer Tag würde kommen - Denn so stand es geschrieben...',},['SizeY']=30,['Groups']=0,['Pitch']=4.722861,['X']=50476.045372,['Color']=141591,['Id']=1410,['Alpha']=1,['SizeZ']=30,},[4]={['SizeX']=59,['Contrast']=1,['X']=50588.188971,['Alpha']=1,['Z']=47328.004618,['Color']=979098,['Yaw']=4.946263,['SizeY']=56,['Groups']=0,['Pitch']=0,['Y']=4342,['EffectType']=72,['Id']=1411,['Roll']=0,['SizeZ']=56,},[5]={['EffectType']=8503,['SizeX']=26.456456,['Contrast']=3.150000,['Roll']=0,['Yaw']=1.270600,['Z']=51087.426367,['Y']=12411,['MetaData']={['title']='Das Streben nach Wissen',['message']='Auf seinen Reisen durch Tamriel begegnete Biro-dar anderen Gelehrten, die wie er nach Wissen strebten und schon bald waren sie eine eingeschworene Gemeinschaft. Getrieben von unbändigem Wissensdurst suchten sie an entlegenen Orten nach alten Büchern und durchforsteten Bibliotheken nach unbekannten Schriften. \\n\\nIhre Bestrebungen blieben auch dem grossen Hermaeus Mora nicht verborgen. Wachsam und mit wachsendem Interesse folgte sein Blick ihrem Tun. Schliesslich offenbarte er sich dem stärksten Magier unter ihnen und gab ihm die Macht ein Portal in seine Ebene zu öffnen. Azandar folgte dem Ruf und betrat gemeinsam mit seinen Gefährten das Reich von Hermaeus Mora. Überwältigt von dem unendlichen Wissensschatz, knieten die Gelehrten vor dem allwissenden Auge und baten um die Erlaubnis die Bücher in seiner Bibliothek studieren zu dürfen. \\n\\nHermaeus Mora gab ihrem Wunsch nach, doch verlangte er als Preis Ihre ewige Gefolgschaft. Und so sandte er sie zurück nach Tamriel, um verschollene Bücher zu finden, die andere vor ihm zu verbergen suchten, und diese in sein Reich zurückzubringen. \\n\\nAls Gegenleistung für ihre Mühen erhalten die Magier Zugriff auf seine unendliche Bibliothek, deren Bücher sie über ein Portal in ihr Haus am Amayasee holen. \\n\\nBesonders gefährliche Exemplare werden in einem sicheren Gebäude am Rande des Anwesens gelagert. Dort wacht Gerissen-wie-die-Nacht über ihre Sicherheit und wird alles in seiner Macht Stehende tun, um die Welt vor ihnen zu schützen. \\n',},['SizeY']=30,['Groups']=0,['Pitch']=4.625123,['X']=49043.967856,['Color']=731813,['Id']=1412,['Alpha']=1,['SizeZ']=30,},[6]={['SizeX']=60,['Contrast']=1,['X']=49041.762197,['Alpha']=1,['Z']=51085.264932,['Color']=959699,['Yaw']=1.008800,['SizeY']=60,['Groups']=0,['Pitch']=0,['Y']=12409,['EffectType']=72,['Id']=1413,['Roll']=0,['SizeZ']=60,},[7]={['SizeX']=59,['Contrast']=1,['X']=50466.946195,['Alpha']=1,['Z']=47281.564985,['Color']=979098,['Yaw']=4.946263,['SizeY']=56,['Groups']=0,['Pitch']=0,['Y']=4341,['EffectType']=72,['Id']=1414,['Roll']=0,['SizeZ']=56,},[8]={['SizeX']=79,['Contrast']=1,['X']=50474.161331,['Alpha']=1,['Z']=47448.476288,['Color']=979098,['Yaw']=4.946263,['SizeY']=76,['Groups']=0,['Pitch']=0,['Y']=4250,['EffectType']=72,['Id']=1415,['Roll']=0,['SizeZ']=76,},},}"
