R["oh__@urhart"]="{['eu']={[33]={['D']='As the Orcs are one of the most lovable races in the Elder Scroll\\'s I wanted to make them a pretty place to do some smithing.\\r\\nNarboth agreed to watch over it and as such I made a bedroom for them.\\r\\nThe best feature though is the garden round the 2nd floor plenty of benches to sit and wait for inspiration. PLease allow some privacy and dont open the wooden gates at the back.',['N']='Narboth\\'s smithery',['O']=19014,['C']=1.026000,},[82]={['D']='Place for Prayers (Or Prayes for Placers)\\r\\n\\r\\nUpon entering the house you are greeted by the enchanted whufting Dogwood trees.\\r\\nThey will help you breathe more freely as beyond their mist all will become clear.\\r\\nAnd it is a house to be free in. To seek being free of the world and stroll around in your own thoughts.\\r\\n\\r\\nThere are numerous spots to kneel in prayer or sit and have a drink with a companion observe the flow of time Best place to sit is near Sister Gellenna\\'s hut.',['N']='Place for Prayers',['O']=19843,['C']=1.021000,},[79]={['N']='Azurah\\'s Shrine',['O']=18777,['C']=1.021000,},[81]={['N']='Urhart\\'s Gallery',['O']=18790,['C']=1.030000,},[70]={['N']='Bar of the Colossus',['O']=18771,['C']=1.013000,},[13]={['N']='Poetry penn',['O']=18774,['C']=1.051000,},[40]={['O']=18738,['N']='Topal Bay Island',},[72]={['D']='Ready for Halloween. \\nOr am I just growing some shrooms for Alice?',['N']='Mushroom Cellar',['O']=19252,['C']=1.007000,},[26]={['D']='The house is modified to house a \\'retired\\' speaker wanting to have a place to live with their reachfolk witch. Not being fans of depending on hargravens they try to make their own Briarhearts\\r\\nHeart of thorn... bones of the wild... in life, Forsworn... rise from death, Blood of our Blood.',['N']='Cyrodiil Gatehouse',['O']=19294,['C']=1.002000,},[75]={['D']='It is an Orsinium residence as will become clear by the resident keepers.\\r\\nOriginally created by a fan to accomodate a lady performer known for good taste but not being a too delicate flower.\\r\\n\\r\\nWater has been made an important feature in this build.\\r\\nThe slaughterfish repellant is working its magic so swimming is absolutely safe.\\r\\nWhich means the fishing is good because the other fish want to go there as well.\\r\\n\\r\\nIt was designed to accomodate a few couples and has several Dibella references.',['N']='Safe Port',['O']=19693,['C']=1.014000,},[44]={['D']='Vegaas is the home of Mirri.\\r\\nShe opened her inner house to several adventurers and does not check up on them.\\r\\nThe house dedicated to the Three. Mirri\\'s domain is the yard and garden.Go enjoy a mud or water bath. Sit outside raine or shine. The main house is taken over by the adventurers who have their set paths to go about their business.\\nEnjoy this from the rocking chair. ',['N']='Mirri\\'s Veegas',['O']=18909,['C']=1.021000,},[29]={['D']='Welcome to Rigurt\\'s new home for the Glorious Expedition for Nord Cultural Exchange.\\r\\nOn the first floor you will find a conference room and a modest bar with a kitchen.\\r\\nThe Conference room is the heart of the GEFNCE where we craft our plans for visits to the rest of nations of Tamriel.\\nIf you want to join the Glorious Expedition for Nord Cultural Exchange, contact Alfrikke to make an appointment\\nUp the stairs there is a podium for lectures or a band, we have provided various music boxes.',['N']='Glorious EFNCE HQ',['O']=19267,['C']=1.007000,},[62]={['N']='Urhart Garden Estate',['O']=18777,['C']=1.018000,},[95]={['D']='The thought behind the room...\\nThe chaired man is the author of the book on the table. A pirate poem.\\nAfter this one poem his inspiration dried up and he was subjected to torture technique \\'Failure\\' \\nas described in vol 13 of proper torture techniques. \\nIt makes him lash out to his fellow pirates. Thus killing the only ones he cared for and alas subjecting himself \\nto the superior torture as prescribed in volume 8 \\nLove crushed. \\n\\nSad isn\\'t it.',['N']='One poem wonder',['O']=19449,['C']=1.002000,},},['TS']=1714472607,['Version']=1773,['Key']='oh__@urhart',}"
