R["oh__@aireal"]="{['na']={[1]={['D']='a small zoo Exhibit',['C']=1.030000,['O']=19271,['N']='a 2nd exhibit',},[2]={['D']='After kicking out the Deadra worshipers.. can you believe that? And after they swore they were not! \\n\\nWe turned the room into a cozy Christmas getaway.\\n\\n*Being in 1st person helps to view, but a close over the shoulders 3rd is fine.',['C']=1.022000,['O']=19691,['N']='Christmas Room',},[3]={['D']='Princess\\'s  home.',['C']=1.007000,['O']=19651,['N']='La Casa Princesa',},[4]={['D']='This In Room started as an example for a housing contest... and I went in a different dirrection. It Started as \\'Minimalist\\'..and isn\\'t now.',['C']=1.500000,['O']=18860,['N']='Skywatch Apartment',},[5]={['D']='Welcome to my shrine to the Moon & Stars.\\n\\nA small place for Khajiit to come and feel at peace while being very far from home.',['C']=1.002000,['O']=19074,['N']='Moon & Stars shrine',},[6]={['D']='My Frost Warden ( Zirien Mobaden ) loves the warm feeling of her home away from Clockwork City. \\n(redone 9/27/21)',['C']=1.007000,['O']=18870,['N']='Mournhold Apartment',},[7]={['D']='Just a spooky little house.. The dead stay that way... updated 9/10/23',['C']=1.023000,['O']=19610,['N']='Nightshade',},[10]={['D']='The Lady in question is my Mother, I think of her every time I create a garden,..  I hope you enjoy them as much as I think she would have.',['C']=1.021000,['O']=18946,['N']='The Ladies Garden',},[11]={['D']='Ay\\'Anna\\'s Tree House.  She loves the view across the swamp, though often decides to sleep in the mushroom cave instead of trying to drunkenly climb the mushroom stairs.',['C']=1.021000,['O']=18873,['N']='Stormhold House',},[13]={['D']='A Cozy little garden.',['C']=1.021000,['O']=19779,['N']='A Cozy Garden',},[15]={['D']='Oltre il lampione or Beyond the lampost, is a house build for Nordenheim\\'s Animated contest. ( done 12/30/21).   It is based off of The Lion, The Witch and the Wardrobe, one of my favorite books growing up. Their are 2 FX in this house, if you miss them, it\\'s ok, they are at the begining and end, to cover the original door.. and lack their of.  :)',['C']=1.002000,['O']=18991,['N']='Oltre il Lampione',},[16]={['D']='This is one of my Christmas houses. \\n\\n( I don\\'t  have ESO + atm, so it\\'s not as full as it could be.. but it IS done)',['C']=1.022000,['O']=18938,['N']='Casa di Natale',},[19]={['D']='A Room with a view',['C']=1.021000,['O']=19616,['N']='A Room with a View',},[22]={['D']='A Humble home for Shan-Fyrgjli-Aarit one of my PvP characters.',['C']=1.007000,['O']=19017,['N']='Shan\\'s house',},[23]={['D']='This is Celan De\\'Jana\\'s home,  and he welcomes you. He may be out on a job so just make yourself at home!\\n\\nCelan warns that he likes his trophies and you may have a phobie triggered by the items in the Jesters Boxes.. ( the hand reaching out in one may for a second look like a snake. Also the Alter to Sithis is littered wth bones and blood, so if you have a squimish side, you might avoid that!',['C']=1.007000,['O']=19078,['N']='Rawl\\'kha House',},[25]={['D']='This is Dae\\'s  home when she is not in Rimmen crafting for her friends.  ( 9/2 small update to inside)',['C']=1.021000,['O']=18872,['N']='Dae\\'s Garden',},[28]={['C']=1.007000,['O']=18857,['N']='Drystan\\'s Lodge',},[31]={['D']='',['C']=1.023000,['O']=18938,['N']='Salutate Mortem',},[64]={['D']='Treasure hunters dig site. It\\'s best to enter the house from the top entrance, though the whirlpool is active, but either way is fine. I am still working it adding things.',['C']=1.007000,['O']=18845,['N']='Tesoro Oculto',},[49]={['D']='Herb loved his plants and even opened a shop, then s omething went wrong and the plants started needing a more... meaty diet and then he noticed an area behind his shope opened up and more horrors than he could imagine walked out  of a portal.. but they supplied him with the meat his plants needed, until they didn\\'t and Herb has not been seen by his family in quite a while.',['C']=1.023000,['O']=19269,['N']='LSoH',},[34]={['C']=1.031000,['O']=18811,['N']='A\\'Darien\\'s Oasis',},[35]={['D']='A Small library dedicated to learning and knowledge.. and maybe a Deadric Prince.',['C']=1.025000,['O']=19525,['N']='A Small Library',},[100]={['D']='My Arcanisits home base in Necrom.',['C']=1.026000,['O']=19522,['N']='Necrom Inn',},[68]={['D']='Dae\\'s Home away from home. ( Dae is my main crafter and works out of Rimmen.. and told me her apartment sucked and she wanted a better one... so now she has it!)',['C']=1.007000,['O']=18862,['N']='Dae\\'s Inn Room',},[70]={['D']='Also Garden.. Each area is slightly different in theme. Both the inner area and HoC has been updated.  02/05/22',['C']=1.003000,['O']=19028,['N']='Rimmen Temple',},[87]={['D']='Just a small zoo exhibit',['C']=1.030000,['O']=19271,['N']='Leyawiin Inn',},[88]={['D']='My crafting house.. it\\'s set up like \\'stores\\' for the various crafts',['C']=1.500000,['O']=18988,['N']='Craft Stores',},[90]={['D']='This is a spooky senic tour with 4 area\\'s... 3 are just for looks.. the 4th has a semi-easy jump puzzle at the end.',['C']=1.003000,['O']=19174,['N']='Deadlands Plot',},[42]={['D']='A simple meditation garden.  \\n\\nredone 4/2/22 \\n(complete change from an apartment )',['C']=1.021000,['O']=19085,['N']='Vivec City Inn',},[59]={['D']='Baran and his rather quirky family call this house their home during the Christmas and New Life holidays. While Legate Naiose leads the charge in Cyrodiil, he knows the value of a comfortable home to get away from the crys of battle. Please enjoy the garden, but don\\'t feed Fred..he\\'s getting a bit chunky and can\\'t hop around as well as he used to.',['C']=1.022000,['O']=19672,['N']='Alinor House',},[58]={['C']=1.007000,['O']=18811,['N']='Alinor Inn',},[77]={['D']='Just a room for a weary traveler to rest their head.',['C']=1.007000,['O']=18878,['N']='Solitude Inn',},[81]={['D']='My Explorer\\'s Christmas home.',['C']=1.022000,['O']=18977,['N']='Hjaalmarch Gallery',},[95]={['D']='Just an Inn room for a nice night away from home. with a cozy seating area.',['C']=1.046000,['O']=19178,['N']='Gonfalon Bay Inn',},},['Key']='oh__@aireal',['eu']={[68]={['D']='This is Ash\\'Vini\\'s room when she is in Rimmen.  Ash is a Bosmer Tader, who is branching out to Elswyer at the moment.',['C']=1.007000,['O']=18999,['N']='Rimmen Inn',},},['Version']=1773,['TS']=1708912660,}"
