you should be careful.\\n\\nHe also put the cup of wine and the cheese there. I don\\'t know why. ',['title']='Warnung/ Warning',},['X']=30581,['Yaw']=1.570796,['EffectType']=8503,['SizeX']=166.456456,['SizeY']=170,['Color']=102439,['Z']=98008,['Y']=21614,['Roll']=0,['Pitch']=4.712564,['Contrast']=1,['Groups']=0,['Id']=1432,['SizeZ']=170,['Alpha']=1,},[20]={['X']=30575,['Id']=1433,['Color']=649599,['Z']=98027,['Contrast']=2.700000,['SizeX']=100,['SizeY']=100,['Y']=21626,['Roll']=0,['Pitch']=1.570971,['EffectType']=7,['Groups']=0,['Yaw']=1.570796,['SizeZ']=100,['Alpha']=0.860000,},[21]={['MetaData']={['furniture']='4637672198362211358',},['X']=27502,['Yaw']=4.712389,['EffectType']=1005,['SizeX']=2280,['SizeY']=1000,['Color']=494949,['Z']=97404,['Y']=18887,['Roll']=0,['Pitch']=0,['Contrast']=1,['Groups']=0,['Id']=1435,['SizeZ']=1000,['Alpha']=1,},[22]={['X']=22796,['Id']=1437,['Color']=649599,['Z']=97101,['Contrast']=3,['SizeX']=100,['SizeY']=100,['Y']=19733,['Roll']=0,['Pitch']=1.570971,['EffectType']=7,['Groups']=0,['Yaw']=1.570796,['SizeZ']=100,['Alpha']=0.860000,},[23]={['MetaData']={['message']='Das tat weh!\\n\\nIch habe schon einmal in den nächsten Raum geschaut. Er hat den Kopf eines Clannbann mit einer üppigen Verzierung an die Wand gehängt und dabei immer wieder \"Welpi-Mörder\" gemurmelt. \\n\\nAls sein Diener ihn daran erinnerte, dass er an Welpis Ende beteiligt war, verwandelte er ihn in einen Skamp und schnallte ihm einen Rucksack gefüllt mit \"aromatischem\" Käse um. Seitdem versucht sein Diener, dem Gestank zu entkommen - mit mäßigem Erfolg.  \\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nThat was painful!\\n\\nI took a look into the next room. He put the head of a clannfear with a huge decoration on the wall and murmured again and again \"Puppy-killer\". \\n\\nWhen his servant reminded him, that he was involved in Puppy\\'s ending, he transformed him into a scamp and strapped a backpack with \"aromatic\" cheese on him. Since then his servant tries to escape the smell - with modest success. \\n\\n',['title']='Aua!',},['X']=22808,['Yaw']=5.581563,['EffectType']=8503,['SizeX']=126.456456,['SizeY']=110,['Color']=102439,['Z']=97099,['Y']=19709,['Roll']=0,['Pitch']=4.705408,['Contrast']=1,['Groups']=0,['Id']=1438,['SizeZ']=110,['Alpha']=1,},[24]={['X']=29505,['Id']=1440,['Color']=649599,['Z']=94379,['Contrast']=3.080000,['SizeX']=100,['SizeY']=100,['Y']=18832,['Roll']=0,['Pitch']=1.563815,['EffectType']=7,['Groups']=0,['Yaw']=1.490511,['SizeZ']=100,['Alpha']=0.860000,},[25]={['MetaData']={['message']='Ihr solltet diesem seltsamen Stab nicht zu nahe kommen. Andere Leute, die ihn anschauen wollten, sind ... nicht mehr sie selbst. \\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nDon\\'t get too close to that strange stuff. Other people who wanted to take a look at it are ... not themselves anymore.',['title']='Oink!',},['X']=29513,['Yaw']=4.712389,['EffectType']=8503,['SizeX']=66.456456,['SizeY']=70,['Color']=102439,['Z']=94398,['Y']=18811,['Roll']=0,['Pitch']=4.974188,['Contrast']=1,['Groups']=0,['Id']=1441,['SizeZ']=70,['Alpha']=1,},[26]={['X']=18958,['Id']=1442,['Color']=990089,['Z']=97150,['Contrast']=1,['SizeX']=26.456456,['SizeY']=30,['Y']=25504,['Roll']=0,['Pitch']=4.712564,['EffectType']=902,['Groups']=0,['Yaw']=1.748820,['SizeZ']=30,['Alpha']=1,},[27]={['X']=18958,['Id']=1443,['Color']=649599,['Z']=97157,['Contrast']=1,['SizeX']=80,['SizeY']=80,['Y']=25505,['Roll']=0,['Pitch']=1.570971,['EffectType']=7,['Groups']=0,['Yaw']=1.570796,['SizeZ']=80,['Alpha']=0.860000,},[28]={['X']=22434,['Id']=1445,['Color']=649599,['Z']=96656,['Contrast']=2.840000,['SizeX']=100,['SizeY']=100,['Y']=22025,['Roll']=0,['Pitch']=1.570971,['EffectType']=7,['Groups']=0,['Yaw']=1.570796,['SizeZ']=100,['Alpha']=0.860000,},[29]={['MetaData']={['message']='Verehrtes Publikum! \\n\\nIhr seht heute die berühmte, einzigartige und geniale Tramödie des Meisters! \\n\\nEr wird nur immer traurig, wenn das Stück sich seinem Ende nähert. Daher könnte es sein, dass er das Stück nochmal aufführt. \\n\\nBöse Zungen behaupten, dass ihm die Darsteller ausgehen und Teile des Publikums während der Aufführung an Altersschwäche gestorben wären ... aber das ist nicht wahr!\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nLadies and Gentlemen! \\n\\nToday you\\'ll see the famous, unique and ingenious tromedy of the master! \\n\\nHe just gets sad when play approaches the end. So it could happen, that he starts the play again. \\n\\nSharp tongues say that he\\'s running out of actors and parts of the audience died during the play because of senile decay ... but that is not true!',['title']='Applaus!',},['X']=22439,['Yaw']=5.235988,['EffectType']=8502,['SizeX']=66.456456,['SizeY']=70,['Color']=102439,['Z']=96644,['Y']=22019,['Roll']=0,['Pitch']=4.708898,['Contrast']=1,['Groups']=0,['Id']=1446,['SizeZ']=70,['Alpha']=1,},[30]={['X']=20906,['Id']=1449,['Color']=649599,['Z']=101333,['Contrast']=1,['SizeX']=80,['SizeY']=80,['Y']=22019,['Roll']=0,['Pitch']=1.570971,['EffectType']=7,['Groups']=0,['Yaw']=1.570796,['SizeZ']=80,['Alpha']=0.860000,},[31]={['MetaData']={['message']='Wirf einfach den falschen Gast aus dem Haus, um deine Ferienwohnung zu beziehen.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nJust throw out the false guest and you can move into your holiday home.',['title']='Bye bye',},['X']=20896,['Yaw']=2.007129,['EffectType']=8503,['SizeX']=86.456456,['SizeY']=70,['Color']=102439,['Z']=101369,['Y']=21987,['Roll']=0,['Pitch']=4.625123,['Contrast']=1,['Groups']=0,['Id']=1450,['SizeZ']=70,['Alpha']=1,},[32]={['X']=20171,['Id']=1451,['Color']=649599,['Z']=101741,['Contrast']=2.750000,['SizeX']=100,['SizeY']=100,['Y']=23076,['Roll']=0,['Pitch']=1.570971,['EffectType']=7,['Groups']=0,['Yaw']=1.570796,['SizeZ']=100,['Alpha']=0.860000,},[33]={['MetaData']={['message']='Er ist völlig fasziniert von dieser Alfiq. Als er in der Gestalt eines Alfiq war, wurde er von seiner Sucht nach Milch besiegt. Dieses Exemplar scheint jedoch völlig resistent dagegen zu sein ... interessant!\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nHe is completely fascinated of this alfiq. When he was in the shape of an alfiq, he was defeated by his addiction to milk. But this exemplar seems to be resistant to it ... interesting!',['title']='Miau!',},['X']=20175,['Yaw']=4.017748,['EffectType']=8503,['SizeX']=66.456456,['SizeY']=70,['Color']=102439,['Z']=101733,['Y']=23067,['Roll']=0,['Pitch']=4.660029,['Contrast']=1,['Groups']=0,['Id']=1452,['SizeZ']=70,['Alpha']=1,},[34]={['X']=18909,['Id']=1453,['Color']=649599,['Z']=106905,['Contrast']=2.800000,['SizeX']=100,['SizeY']=100,['Y']=28376,['Roll']=0,['Pitch']=1.570971,['EffectType']=7,['Groups']=0,['Yaw']=1.570796,['SizeZ']=100,['Alpha']=0.860000,},[35]={['MetaData']={['message']='Ihm gelüstet nach einer neuen Herausforderung. \\n\\nWer durch das Mondtor springt, bekommt hervorragenden Wein und Käse. \\n\\nWer nicht springt, wird seine langandauernden Ferien hier verbringen und Schmetterlinge jagen und unheimlich glücklich sein. \\n\\nDie Wahl ist doch einfach, oder? Was werdet ihr tun?\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nHe craves for a new challenge. \\n\\nThose who jump through the moongate will get outstanding wine and cheese. \\n\\nThose who don\\'t jump will spend their long-lasting holidays here and hunt butterflies and be incredibly happy. \\n\\nIt\\'s an easy choice, isn\\'t it? What will you do?\\n',['title']='Aaaaaah!',},['X']=18913,['Yaw']=3.141593,['EffectType']=8503,['SizeX']=126.456456,['SizeY']=70,['Color']=102439,['Z']=106905,['Y']=28360,['Roll']=0,['Pitch']=4.691445,['Contrast']=1,['Groups']=0,['Id']=1454,['SizeZ']=70,['Alpha']=1,},[36]={['X']=19404,['Id']=1455,['Color']=323765,['Z']=98695,['Contrast']=2.160000,['SizeX']=100,['SizeY']=100,['Y']=23476,['Roll']=0,['Pitch']=0,['EffectType']=888,['Groups']=0,['Yaw']=0.153589,['SizeZ']=100,['Alpha']=0.540000,},[37]={['X']=19510,['