R["oh__@taerchen"]="{['eu']={[18]={['O']=19418,['C']=1.026000,['D']='I have made a Home for Isobel where she lives when she is not travelling with me.',['N']='Home of Isobel',},[88]={['O']=19462,['C']=1.026000,['D']='A house for Mirri and Bastian, each has their own area. I wonder if they are just neighbours or friends. :D',['N']='Mirri and Bastian',},[31]={['O']=19329,['C']=1.013000,['D']='This is the orcish Sportsbar \\'Old Dragon\\' near the arena. With jukebox, TV and an arcade game. Build for a guild event and got the third place.',['N']='Orcish Sportsbar',},[43]={['O']=19396,['C']=1.005000,['D']='Floating Isles\\nA secluded property once inhabited and used by a magician. Apparently he experimented with levitation spells. Long forgotten, nature has reclaimed this area. Find your way up through the thicket until you can see the sun or the moons again and maybe you will find a nature spirit or two.',['N']='Floating Isles',},[11]={['O']=19576,['C']=1.021000,['D']='A lovely garden prepared for a nice BBQ. We are hoping for good weather. :)',['N']='BBQ Party',},[12]={['O']=19329,['N']='Gemstone Cave',},[15]={['O']=19564,['C']=1.021000,['D']='A big colorfull garden devoted to Dibella. With many flowers and prepared to practise all teachings of Dibella (and some more).',['N']='Dibella\\'s Lustgarten',},[62]={['O']=19333,['C']=1.037000,['D']='An ancient coral cave where you can find a temple for the eight Divines and one for Auriel, too.',['N']='Coral Cave Temple',},[79]={['O']=19576,['C']=1.020000,['D']='The Home of my Vampire Sarela Latharion. She is a scholar highelf and very interested in the dwemer. ',['N']='Home of a Vampire',},},['TS']=1691427442,['Version']=1773,['Key']='oh__@taerchen',}"
