R["oh__@tilmiri"]="{['Version']=1773,['eu']={[17]={['C']=1.013000,['N']='Stammlokal',['D']='\"Stammlokal der Eisernen\"\\n\\nEndlich haben wir ein Stammlokal, wo wir uns treffen können. Dort können wir feiern, leckeres Essen genießen, hochprozentige Getränke trinken und wer mag kann dort auch singen und tanzen.\\nViel Spaß beim zusammen sein.\\n\\nEs gibt nur ein Verbot, Bierflaschen werden nicht geworfen. Wer es doch macht muss singen und zwar die Lieder die die anderen hören wollen.\\n\\nEure Lokalbesitzerin.',['O']=19053,},[5]={['C']=1.030000,['D']='a little Elswery Museum',['N']='Museum',['O']=19425,},[56]={['C']=1.026000,['N']='Kvatch-Freistatt',['D']='You need help, have no courage for the black sacrament? Then come here and let me help you.\\r\\nDrawn the shadow\\n\\nDu brauchst Hilfe, hast keinen Mut fürs schwarze Sakrament? Dann komm her und lass dir von mir helfen. \\r\\nGezeichnet der Schatten',['O']=18844,},[43]={['C']=1.021000,['N']='Hlaalu-Haus',['D']='Gardeners wanted!\\r\\nMy garden and I are looking for a loving plant friend,\\r who takes care of all the trees and flowers in my garden.\\r\\nA small home and food will be provided for you,\\r\\nand there is a wonderful view here too.\\r\\nDo you love gardening and have the perfect green thumb,\\r then apply to me.\\r\\nMy plants are already looking forward to you.\\r\\n\\r\\nThere is only one thing to consider:\\r\\nNEVER enter the main house!\\r\\n\\r\\nDrawn,\\r\\nthe much travelers',['O']=18958,},[46]={['C']=1.022000,['N']='Liebesnest',['D']='Das Liebesnest,\\nder perfekt Ort für Verliebte und für die, die sich trauen den Bund einzugehen.\\nKuschelige kleine Zimmer und eine schöne Gartenanlage laden zum kuscheln, knuddeln und lieben ein.',['O']=19197,},[91]={['C']=1.026000,['N']='Luxus-Freistatt',['D']='A beautiful house, but sometimes it is better not to know who lives in the house.',['O']=19039,},[44]={['C']=1.022000,['N']='Redoran-Haus',['D']='Liebeshöhle\\n\\n\"In diesem Haus is nur Platz nur für mein Schnuckelchen und mich, also haben wir zwei genügend Raum für  verschiede Liebesspiel und kleine Experimente =^.^= wir wollen dort nicht gestört werden, wer es doch wag.... naja die Liebe eines bestimmten Bosmer geht durch ihren Magen  \"\\n\\nDie schattenhafte Bosmer und ihr Schnuckelchen',['O']=19093,},[61]={['C']=1.022000,['N']='Werwolfhöhle',['D']='Urlaubsort für Pelzige Bewohner Tamriels !!\\nDich nerven schreiende Personen in deiner Nähe nur wegen deinem Anblick?\\nDann mach doch mal hier mit deinen Freunden Urlaub und renne frei und ungestüm durch die Gegend!\\nWer kleine Truhen suchen möchte um die Nase zu trainieren, kann dies auch gerne machen.\\nNicht vergessen: Schnappi muss gefüttert werden. Und bitte verärgere den taubstummen Hausmeister Hubert nicht!!',['O']=19144,},[94]={['C']=1.026000,['N']='Unterwasserfreistatt',['D']='Unterwasserfreistatt\\n\\nManche Ruinen bergen ein dunkleres und totbringendes Geheimnis als du ahnst. Daher sei gewarnt beim Betreten dieser Ruine, wer weiß wer da vielleicht wohnt.',['O']=19281,},[78]={['C']=1.012000,['D']='Ein bescheidenes Heim mit zwei Aquariumen',['N']='Stadthaus in Einsamkeit',['O']=19448,},},['TS']=1680378838,['Key']='oh__@tilmiri',}"
