R["oh__@bromthebard"]="{['TS']=1674894002,['Key']='oh__@bromthebard',['na']={[88]={['D']='Come kick off your boots and relax at the Greenseed Tavern & Inn located in the middle of your journey deep in the forest. Features a bar, a kitchen, smoke shack, several sitting areas, and sleeping quarters. ',['C']=1.007000,['O']=19385,['N']='Greenseed Tavern&Inn',},[57]={['D']='Welcome To Brom\\'s Bazaar! The outside is a furniture bazaar where I sell various furniture. Inside is a shopping mall that features a bakery, a bank, a food court with several stalls, and seating areas on the first floor. The second floor features a clothier shop, a pottery shop, and 2 balcony seating areas. Come on by and check it out!',['C']=1.041000,['O']=19235,['N']='Brom\\'s Bazaar',},[26]={['D']='This is the home of my vampire necromancer, Islanzadi The Risen. She doesn\\'t care that people know she\\'s a vampire Necro and is proud of it. The story behind it is the walls were raised up out of Oblivion to form a cave-like structure. Deadra killed the owner, but were eventually routed. The house was sold cheap as-is. She bought it and decided to keep the walls because she liked it and thought it was perfect for a lair. 1st person is recommended for any of my homes',['C']=1.023000,['O']=19235,['N']='Vampire House',},[29]={['D']='This is the romantic retreat for my main, Arya The Mystic. I originally built this for a guild contest for Heart\\'s Day, but really liked it, so I kept it as a permanent home. It is supposed to be her perfect romantic getaway spot to relax and have some private time with her significant other. I wanted the place to feel romantic, yet homely and comfortable as possible',['C']=1.016000,['O']=19235,['N']='Romantic Getaway',},},['Version']=1771,}"
