R["oh__@figmentpigment"]="{['Key']='oh__@figmentpigment',['Version']=1771,['na']={[34]={['O']=18408,['N']='Summershade',},[4]={['O']=18408,['N']='Cake Shop',},[6]={['O']=18900,['N']='Blood Bar',},[7]={['O']=18417,['N']='Nihelenia\\'s Lab',},[9]={['C']=1.016000,['D']='Tamriel\\'s first park designed to the refined standards of the Altmer! Novelty souvenirs, refreshments, and water closets are available by the gates. Around the park grounds you\\'ll find an enchanted carousel, barbaric swinging ship, and the Clockwork cog-spinner! Our main hall currently hosts a journey over the sea to sample the cultural highlights of Elsweyr; our Dragonguard sponsors ask that you spare a moment for the exhibits on their current trials as you pass through the queue.',['N']='Amusement Park',['O']=18812,},[10]={['O']=18513,['N']='Black Marsh Base',},[44]={['C']=1.024000,['D']='',['N']='Velothi Fishing Co.',['O']=19251,},[77]={['C']=1.500000,['D']='Portrait studio with dye station and black, white, and green backdrops (toggle the black clockwork switch for green, or toggle both black and green if you\\'d rather use white). If you need colored lighting, hlaalu lamps are available at the center of each paper lantern.',['N']='Portrait Studio',['O']=19220,},[78]={['O']=18916,['N']='Proudspire Manor',},[16]={['O']=19143,['N']='The Gilded Mammoth',},[81]={['C']=1.022000,['D']='Our healing springs are temporarily open to the public--all are welcome to celebrate the winter holiday with us! Dinner is provided once a day in the great hall. Guests with donations of gold or food for the feasts are welcome to spend the night in the sleeping quarters upstairs. Any guests who wish to drink the mineral water for their health visit the old fountain to the right of the bathing pools; speak with our housekeeper if you need any assistance.',['N']='Alpine Springs Lodge',['O']=18812,},[19]={['O']=19073,['N']='Vampiric Chapel',},[22]={['C']=1.024000,['D']='Cozy tea and cake shop located just outside of Senchal.',['N']='Sereyne\\'s Tea House',['O']=18819,},[23]={['C']=1.037000,['D']='Abandoned temple converted into a luxurious home for two.',['N']='Old Temple Oasis',['O']=19276,},[36]={['C']=1.018000,['D']='Crumbling, abandoned house converted into the base for an Argonian smuggling ring. Enter through the front door and climb the mushrooms to access the main hub, or slip through the fence to the left for an easier route (just .. watch your step). Two hidden portals: one tucked inside a hidden escape route in case of raids, and the other alongside a sunken seaside treasure trove. If you have time for a swim, there are diving boards on top of the lookout tower and the wall.',['N']='Smugglers Base',['O']=18812,},[26]={['O']=18552,['N']='Mage\\'s Library',},[2]={['O']=18408,['N']='Bremusa\\'s Room',},[28]={['O']=18823,['N']='Craftsman Lodge',},[61]={['C']=1.037000,['D']='Rustic lodge for followers of Hircine to feast and relax between hunts.',['N']='Werewolf Den',['O']=19343,},[58]={['C']=1.021000,['D']='',['N']='Wisteria Suite',['O']=19114,},[31]={['C']=1.043000,['D']='',['N']='Sorcerer\\'s Penthouse',['O']=19114,},},['TS']=1671245037,}"
