R["oh__@angielady"]="{['na']={[16]={['C']=1.013000,['D']='It\\'s Daggerfall\\'s newest Pub! Visit Captain Margaux\\'s for the finest in uncomplicated dining, with house entertainer Hroltar to keep you amused! Fine ale, finer company, fair prices! Visit today!',['O']=18819,['N']='Daggerfall House',},[18]={['C']=1.014000,['D']='An elegant city home, with a full service spa and steam room',['O']=18819,['N']='Wayrest House',},[35]={['C']=1.026000,['D']='An elegant home of a reclusive bounty hunter. Be careful, you could be next.',['O']=18819,['N']='Sentinel House',},[23]={['C']=1.018000,['D']='Looking for a breezy, airy getaway? Relax on the lanai with a cool drink and quiet music, or head upstairs for a shady respite or a hot bath!',['O']=18819,['N']='Rawl\\'kha House',},[8]={['C']=1.051000,['D']='A cozy home :)',['O']=18819,['N']='Marbruk House',},[41]={['C']=1.018000,['D']='A lovely, secluded hideaway from the law. Relax, unwind. No one will find you here.',['O']=18819,['N']='Craglorn Estate',},[43]={['C']=1.026000,['D']='Come visit Vvardenfell\\'s best kept secret, the Amaya Gaming Hall! Situated on a lovely, secluded lake, the Hall prides itself on discretion. What happens at the Hall, stays at the Hall.',['N']='Amaya Gaming Hall',['O']=19190,},[71]={['C']=1.004000,['D']='Sale! Sale! Over 7 million in inventory! Everything is for sale (with the exception of crafting stations & some crown-only items, notably the Clockwork Gazebo). Make an offer! (minimum price is always crafting cost)',['O']=18819,['N']='Elsweyr Meadow',},[29]={['C']=1.051000,['D']='Cozy winter\\'s respite',['O']=18819,['N']='Windhelm House',},[14]={['C']=1.031000,['D']='Welcome to Bouldertree Refuge! A cozy Bed and Breakfast for nature loving guests. Enjoy cozy outdoor sleeping areas ranging from posh to rustic, with indoor and outdoor dining options. Rest, relax, and recharge before your next adventure!',['O']=18819,['N']='Grandpa\\'s Farm',},[78]={['C']=1.013000,['D']='Aminae\\'s Fine Dining! Enj