sive Waren',['message']='\\nDieser ist erfreut, seinen Kunden die erlesensten Waren anbieten zu können. \\n\\nSehr gefragt sind die Aquarien, die jedes Domizil in ein Urlaubsparadies verwandeln. Vielleicht passt eines auch in Euer Haus, hmm?\\n\\nOder wie wäre es mit diesem seltsamen Hammer? Er soll angeblich aus Cyrodiil stammen und magische Kräfte besitzen. Ihr solltet diesen Hammer aber nicht in Eurer Wohnung entzünden, die Nachbarn könnten sich angegriffen fühlen. \\n\\nSehr erlesen ist diese Statue vor Euch, die nicht aufhören kann, Weisheiten mitzuteilen. Nicht jeder ist erfreut darüber, aber vielleicht habt Ihr mehr Sinn für Humor, ja, ja? (Bitte kauft diese Statue! Dieser möchte nicht länger als Flohsack bezeichnet werden!)',},['Pitch']=4.712564,['X']=87349.448432,},[47]={['SizeZ']=43,['Alpha']=1,['Groups']=0,['Z']=89980.080123,['SizeX']=35.456456,['Yaw']=3.015929,['Contrast']=1,['EffectType']=8503,['SizeY']=43,['Id']=2621,['Color']=102439,['Roll']=0,['Y']=23065,['MetaData']={['title']='Angebote der Tatzen-Bank',['message']='\\nHier sind stumpfkrallige Sachen sicher!\\n\\nKontof��hrung:\\nbis zu 20 Buchungen monatlich             10 G\\njede weitere Buchung                               2 G\\n\\nSchließfächer:\\nbis 10 kg monatlich                                20 G\\nfür jedes weitere kg                                  2 G\\nAufbewahrung riesiger Bauteile            50 G\\n\\nKredite:\\nDiese vergibt doch keine Kredite!\\n\\nIn seltenen Fällen wird als Währung auch Mondzucker oder leckerer Thunfisch akzeptiert. \\n\\nDie Preise können sich jederzeit ändern, je nach der Preisentwicklung auf dem Mondzuckermarkt. ',},['Pitch']=4.708898,['X']=87546.074337,},[48]={['SizeZ']=36,['Alpha']=0.940000,['Groups']=0,['Z']=94682.841554,['SizeX']=29.456456,['Yaw']=3.141593,['Contrast']=2,['EffectType']=8503,['SizeY']=36,['Id']=2622,['Color']=284160,['Roll']=0,['Y']=23022,['MetaData']={['title']='Ausstattungen für alle Zwecke',['message']='\\nSeid gegrüßt, edler Kunde! \\n\\nEgal, ob die passende Kleidung für die Wildnis, den Kampf oder das Buffet - oder auch für den Kampf an dem Buffet - benötigt wird, wir haben alles! Der vorzüglich gekleidete Jarl auf dem Porträt ist der Beweis!\\n\\nZwickt die Kleidung, splittert der Stab oder sind die Sachen völlig aus der Mode, kann hier Abhilfe geschaffen werden.\\n\\nBei Ausstattungsfragen wendet Euch an den freundlichen Ork. \\n\\nWenn Ihr die Nähmaschine in Aktion sehen wollt, drückt mehrfach hintereinander den Knopf...',},['Pitch']=4.736824,['X']=93329.633176,},[49]={['SizeZ']=34,['Alpha']=1,['Groups']=0,['Z']=92237.273690,['SizeX']=30.456456,['Yaw']=4.712389,['Contrast']=1.400000,['EffectType']=8503,['SizeY']=34,['Id']=2623,['Color']=483818,['Roll']=0,['Y']=22917,['MetaData']={['title']='Studien',['message']='Es gibt so viel zu erforschen, dass ich gar nicht weiß, wo ich anfangen soll...\\n\\nEs gibt faszinierende Kristalle und Runen, aus denen man mächtige Verzauberungen herstellen kann. Auch die Alchemie fasziniert mich immer wieder, insbesondere die Wirkungen der experimentellen Tränke. Die Halluzinationen waren bemerkenswert!\\n\\nOffenbar fand der Orden meine Studien zu daedrischen Glücksspielen am interessantesten. Diese sollten jedoch auch nur von daedrischen Wesen gespielt werden, da diese nach einer Zeit wiederkommen, sollten sie verlieren. Sterbliche haben da keine Chance...\\n',},['Pitch']=1.570971,['X']=94370.836228,},[50]={['SizeZ']=55,['Alpha']=1,['Groups']=0,['Z']=90913.532581,['SizeX']=33.456456,['Yaw']=3.089233,['Contrast']=1,['EffectType']=8503,['SizeY']=55,['Id']=2624,['Color']=102439,['Roll']=0,['Y']=23017,['MetaData']={['title']='Adusa\\'s Vampirausstattung',['message']='\\nWillkommen, Nachtschwärmer!\\n\\nDiese hat, was Ihr benötigt. \\n\\nFür einen Imbiss hat diese etwas im Nebenzimmer vorbereitet, ja!\\n\\nSollte die Sonne wieder einmal zu lange scheinen oder Jagd auf unsereins gemacht werden, helfen die Notrationen in den Flaschen, diese Zeit zu überbrücken. \\n\\nJeder Nachtschwärmer benötigt außerdem eine lichtundurchlässige Übertagungsmöglichkeit. Das Angebot an Steinsärgen hat diese im Nebenzimmer zusammengestellt. \\n\\nHolzsärge empfiehlt diese nicht, da diese gern von Käfern befallen werden. Dies hat bereits zu unbeabsichtigten Einäscherungen geführt. ',},['Pitch']=1.626647,['X']=93267.619177,},},}"
