R["fx__@dummer_fuchs"]="{['TS']=1617572623,['Houses']={[1]={['TS']=1611607080,['Version']='16.0.9',['HouseId']=15,['Effects']={[1]={['Pitch']=4.625123,['SizeY']=30,['Contrast']=1,['Groups']=0,['Z']=64100,['EffectType']=8502,['MetaData']={['message']='(Englisch below)\\n\\nDuch die Sonne in den Wald\\nDer Abend naht mit leisem Tritt.\\nDunkel wird\\'s und etwas kalt.\\nHaltet ein in eurem Schritt.\\n\\nSicherheit ist auf der großen Lichtung.\\nEin Feuer erleuchtet hell die Nacht.\\nSelbst bei einer Wildtiersichtung\\ngibt der Wald hier auf euch Acht.\\n\\nDie sich\\'re Höhle ist gleich nebenan\\nein paar Stufen nur von hier.\\nÜbernachtet in ihr nur dann,\\nwenn ihr fürchtet jedes Tier.\\n\\nSandige Weiten, vergrabener Schatz.\\nDie Wüstenlichtung ist euer Ziel.\\nEs ist ein gar trockener Platz\\nunter der Sonne warmen Spiel.\\n\\nLichtung der Mysterien ist wundersam,\\ndurch die Ruinen kommt ihr hinunter.\\nIn der Nacht, und auch nur dann,\\nleuchten die Pflanzen dort munter.\\n\\nEisige Lichtung, die kleinste von allen.\\nHinter dem längsten Gang.\\nDoch weiß sie auch zu gefallen,\\nIst das Heim vom Wintermann.\\n\\nInzwischen nur mehr Wald\\nist die Lichtung des Moors. \\nFeucht ist\\'s da und etwas kalt,\\nunterhalb des Tors.\\n\\nDas waren die fünf Lichtungen\\nund die Höhle obendrein.\\nHabt ihr Probleme bei der Sichtung,\\nfolgt Reinecke oder Schackal in den Wald hinein\\n\\n\\n(English)\\nClearings\\n\\nFive Clearings under the morning sun.\\nOne Cave, when the animals out here are no fun.\\n\\nThe big Clearing has the most space.\\nLie at the campfire with stars to gaze.\\n\\nThe dessert Clearing has much sand\\nburied bones and treasure under the land.\\n\\nThe mysterious Clearing is quite the sight!\\nGlow and light in latest night.\\n\\nThe winter Clearing is full of ice,\\nfreezing creatures, white like rice.\\n\\nThe swamp Clearing you won\\'t notice at all\\nTo many trees nowadys, making an easy fall.\\n\\nAnd the Cave, small and warm\\nwith fire and carrots you can stay there until dawn.\\n\\nIf you have trouble finding all,\\nfox or jackal might hear your call.',['title']='Lichtungen',},['SizeX']=26,['Color']=102439,['Roll']=0.034907,['SizeZ']=30,['X']=22305,['Yaw']=4.490732,['Y']=24840,['Alpha']=1,['Id']=1006,},},['World']='eu',},[2]={['TS']=1611793057,['Version']='16.0.9',['HouseId']=13,['Effects']={},['World']='eu',},[3]={['TS']=1617572623,['Version']='16.0.9',['Effects']={},['World']='eu',['HouseId']=83,},},['Key']='fx__@dummer_fuchs',}"
